import React, { useState } from "react";
import "./AdminPanel.css";

const AdminPanel = () => {
  const [activeTab, setActiveTab] = useState("dashboard");

  const renderContent = () => {
    switch (activeTab) {
      case "dashboard":
        return <DashboardView />;
      case "pets":
        return <PetsView />;
      case "volunteers":
        return <VolunteersView />;
      case "blog":
        return <BlogView />;
      case "messages":
        return <MessagesView />;
      default:
        return <DashboardView />;
    }
  };

  return (
    <div className="admin-page">
      <div className="admin-sidebar">
        <h2>Panel Admina</h2>
        <ul>
          <li onClick={() => setActiveTab("dashboard")}>Dashboard</li>
          <li onClick={() => setActiveTab("pets")}>Zwierzaki</li>
          <li onClick={() => setActiveTab("volunteers")}>Wolontariusze</li>
          <li onClick={() => setActiveTab("blog")}>Blog</li>
          <li onClick={() => setActiveTab("messages")}>Wiadomości</li>
        </ul>
      </div>
      <div className="admin-main">
        {renderContent()}
      </div>
    </div>
  );
};

// --- Przykładowe komponenty widoków ---
const DashboardView = () => (
  <div>
    <h3>Panel główny</h3>
    <p>Wiadomości, statystyki, liczba zwierzaków, zadania wolontariuszy</p>
  </div>
);

const PetsView = () => (
  <div>
    <h3>Lista zwierzaków</h3>
    <button>Dodaj nowego zwierzaka</button>
    <ul>
      <li>Pies – Azor</li>
      <li>Kot – Mruczek</li>
      <li>Pies – Rex</li>
    </ul>
  </div>
);

const VolunteersView = () => (
  <div>
    <h3>Wolontariusze</h3>
    <ul>
      <li>Jan Kowalski</li>
      <li>Anna Nowak</li>
    </ul>
  </div>
);

const BlogView = () => (
  <div>
    <h3>Posty na blogu</h3>
    <button>Dodaj nowy post</button>
    <ul>
      <li>Jak adoptować psa – 10.11.2025</li>
      <li>Wskazówki dla wolontariuszy – 05.11.2025</li>
    </ul>
  </div>
);

const MessagesView = () => (
  <div>
    <h3>Wiadomości</h3>
    <ul>
      <li>Wiadomość od Jana: "Chcę pomóc w adopcji psa"</li>
    </ul>
  </div>
);

export default AdminPanel;
